import SearchBar from "../SearchBar";
import style from "../Nav/Nav.module.css";

const Nav = () => {
  return (
    <div className={style.container}>
      <nav><label htmlFor="">ewf</label>{SearchBar}</nav>
    </div>
  );
};

export default Nav;
